import React from 'react';
import './Landing.css';

const Landing = () => (
  <div id="landing" className="container pt-6">
    <div id="landing-background">
      <div id="main-section">
        <content>
          This is some text!
        </content>
      </div>
    </div>
  </div>
);

export default Landing;
